sked with building a mobile gaming console named MAGE. It comprised a primitive Android app and four "nodes" that could be reconfigured for different games. Each node featured a gyroscope, a button, and various colored lights. Our team developed two example games: - **Bop-It** - Nodes illuminated different colors, and the app instructed players to "shake," "press," or "flip" the corresponding node. - **Capture the Nodes** - Nodes were lit with different colors, and pressing a node changed it to the opposing team''s color. The team with the most nodes of their color at the end of a designated period won the game. This project provided me with valuable leadership experience. Although I may not have been the most knowledgeable team member, I learned how to guide a group of exceptionally talented engineers toward a common goal.'),
