 soon found myself moving to northern New Jersey to live with relatives, just a few weeks later. I resided in northern New Jersey for approximately four months before the daily commute to the city became too burdensome. At that point, I decided to move in with my former college roommate in the Murray Hill area of Manhattan in December 2016. Our apartment was conveniently located within walking distance of the FanDuel offices, situated around the Gramercy Park and Madison Square Park areas. '),
