ng media startup desperately needing analytics support, [The Action Network](#https://www.actionnetwork.com/). As his right-hand man, I''d be leading a small team of analysts, charged with developing reporting infrastructure across the media and affiliate branches of the business. Although I didn''t feel as productive initially due to my short tenure, I managed to initiate some small projects that demonstrated my capabilities. '),
