wins that could have come from a more immediate synthesis of our data. The clearest lesson from this period was seeing the importance of strong, aligned leadership in facilitating cross-functional collaboration. However, it was also during this time that we saw a significant shift in our organizational focus from audience to user acquisition. I was deeply involved in facilitating this shift, taking charge of new reporting and analysis to drive the change. The result was the creation of an intricate user acquisition dashboard that tracked the success of our efforts in real time and helped guide our future strategies. '),
