pace who knew how to effectively guide a large team. Chad was completely supportive of the shift from driving Monthly Active Users (MAUs) to boosting revenue. However, he was challenged with motivating his team. Previously, the team had a clear view of their direct impact on our core performance (via the volume of people reading their articles each month). But with the new focus on conversion further down the sales funnel, it became more difficult to discern the real impact of their efforts on our bottom line. In collaboration with Chad and a few team leaders - Katie, Steve, and Andrew - we brainstormed and came up with the concept of a "Value Click." This idea examined the subsequent action a user took after reading an article, investigating whether it was predictive of a future subscription purchase or, better yet, a click on a promotional offer from a sportsbook. While the "Value Click" was primarily used for motivational purposes at this stage and not directly tied to revenue, it marked a significant win for the team. The new metrics were split by platforms and sessions on each platform, which gave us a more granular understanding of user behavior. Creating this custom metric was a considerable professional milestone for me. It wasn''t my first time creating custom metrics, but it was the first time I ideated and led a project of this magnitude. I learned much about my technical abilities, having to write custom queries that tracked each session on each platform and understanding how Value Clicks manifested in the data. More importantly, it forced me to attentively listen to a large team''s needs and deliver a solution to enhance their performance. Through this project, we discovered correlated metrics like "articles read per reader" and "cross-sport readers" that had substantial impacts on our bottom line. '),
