 if we continued to grow at the same pace. April advocated to hire Amanda, and they, along with Billy, played a pivotal role in developing infrastructure to automate the scraping and cleaning of data from nearly two dozen partners. They also presented the data in a way that resolved numerous issues for both Better Collective and Action management. During this project, I learned how to navigate high-pressure leadership situations and the importance of trusting my team to deliver high-quality products. This experience as a manager taught me valuable lessons that would inform my future leadership style. '),
