nd pushed us to aggressively seek out additional affiliate partnerships. I was mindful of the need to give the teams room to breathe, but the urgency of our situation left little room for reprieve. The immense strain we were under began to show, and morale within the company plummeted. This pressure eventually led to the departure of key team members. When Kristin, our Head of People, decided to leave, it marked the beginning of a mass exodus. Over a span of just five months, we lost a significant part of our team. Looking back at this tumultuous period, I realize that it wasn''t the lost deals or missed targets that were the most significant. Instead, it was the relationships with my team, the trust we built, and the morale we lost that affected me the most. I learned an invaluable lesson during this time: the importance of listening to and supporting my team. In the chaos of our situation, I realized that empowering my team should always take precedence over individual tasks, no matter how critical they might seem. Despite these hurdles, the reality was that we still had to deliver on our commitments. The departure of team members meant that I had to pick up additional responsibilities. Working 70-80 hour weeks became the norm, and I found myself reporting directly to Melissa, our CFO for Better Collective in the US. The silver lining in this cloud was the strengthened bonds I formed with my remaining teammates. Their resilience and camaraderie reminded me of why I love being part of a team, and their support was instrumental in helping me navigate this challenging period. '),
