r. This was an efficient model to start the engine of our partnerships and scale swiftly. However, as the market matured and our affiliate revenue outpaced other sources, some underlying issues with this business model became glaringly apparent. The most significant concern was the sustainability of this acquisition-focused model. With each passing day, the pool of new users was shrinking, and our existing customer base was underutilized. We also recognized a misalignment of incentives with our core partners. As we were compensated solely for acquisition, we had little to no incentive to assist sportsbooks in retaining their users. This led to an untenable situation for sportsbooks, many of which were struggling to stay afloat due to the inflow of low-value customers that couldn''t cover the acquisition fees we charged. Acknowledging these challenges, we initiated a shift towards a more balanced and sustainable model - a revenue-share agreement. Under this new arrangement, we would receive a smaller upfront payment for acquiring the user, followed by a percentage of the user''s losses incurred on the sportsbook over a three to five-year period. The shift promised to realign incentives, create a recurring revenue stream, and extract more value from our existing users. However, it posed a significant risk to our short-term revenue during a time when we were already facing financial challenges. As a key player in this transition, my primary task was to build a compelling case for moving from the cost-per-acquisition model to the revenue-share model. The crux of this argument rested on the long-term financial gains we could realize through revenue sharing. To model the lifetime value (LTV) of a user under the new model, I required actual user play data from our partners, along with a range of deal parameters to map against user behavior post-activation on the sportsbook. Fortunately, one of our major partners shared comprehensive, anonymized user-play data from customers we had referred over a 1.5-year period. Using this data, I was able to create user cohorts and project their future play based on retention rates, loss rates, and the timing of their first activation. I then developed filters for various deal parameters (such as revenue-share term length, deal percentage, and upfront payment to us for acquisition), differentiated by the user''s state to account for variations in tax impacts on user LTV. Drawing on my concurrently developed state-level user acquisition forecasts, I then estimated how many users we would acquire and the resulting revenue under either a cost-per-acquisition deal or a revenue-share deal. The culmination of these efforts was a successful presentation to our executive leadership team. I demonstrated how we could trade a high seven-figure revenue reduction in the second half of 2022 for a potential eight-figure revenue upside from 2023 to 2025 with one of our largest partners. I personally explained the rationale behind my user-level retention and losses forecasts, defended the decisions I made, and effectively used charts and graphs to illustrate the immense revenue potential in the clearest terms. This significant project involved high stakes and complex modeling but ultimately showcased the power of data-driven decision-making in shaping our strategic direction. '),
