ation, the team faced difficulty linking control metrics such as Monthly Active Users (MAU), Daily Active Users (DAU), and sessions to value-clicks. Upon conducting an analysis, I identified divergent user behaviours between our web and app platforms. Web users typically exhibited high bounce rates with low conversion, mostly seeking one-off content. Conversely, app users were inclined to subscribe or activate on a sportsbook proportional to their app usage duration. This led to the recognition of ''daily unique readers'' on the web, and ''daily reads per reader'' on the app as the primary Key Performance Indicators (KPIs) for the forthcoming football season, due to their strong correlation with value clicks and subsequent revenue generation. Subsequently, I developed a user-friendly tool on Google Sheets for the team to set reasonable monthly KPI targets by sport, aligned with our company''s revenue objectives. The strong correlation between the identified audience KPIs and revenue generation gave me the confidence to establish these targets using a simple linear regression model. Our team, comprising Chad, Katie, Steve, Andrew, and Korey, then set their YoY improvement targets individually for each month and each sport for the September 2022 to December 2022 period. We convened three meetings over the subsequent fortnight, during which we amalgamated our targets and arrived at a consensus. Korey, a newly inducted analyst, took the lead in operationalizing these targets on Tableau. The result was a well-articulated roadmap for the content team, highlighting clear objectives and tracking mechanisms to evaluate individual contributions towards our overarching corporate goals. '),
