al types with partners, and a multitude of new partners. To tackle this, we started to build an internal data engineering team, migrating our processes from CRON jobs to an Apache Airflow system for enhanced data scrape monitoring and handling the added complexity. However, with Billy, April, and Amanda leaving the company, the project responsibility fell upon myself and a junior analyst, Grant. We were tasked with writing thousands of lines of custom scripts for numerous partners, ensuring alignment with our revenue reporting schemas, all while lacking Python expertise. We built a working model that catered to most of our partners and rapidly hired replacements to assist with the project. Ultimately, we developed a pipeline of scripts in Airflow using Python that accurately reported revenue for the majority of our partners. Our biggest challenge during the fall of 2022 was with partners unable to report accurately, which, nonetheless, was a more favourable problem compared to our situation in the spring of 2022. '),
