otball season against our outdated revenue targets necessitated a complete reforecasting of our 3-5 year revenue plan during our busiest period. The revised forecast revealed an unsettling short-term outlook. Even after significant adjustments by the finance team, we had to make several cuts, including headcount reduction, to stay afloat, given the drastic changes to our business model and general underperformance. A week after the 2023-2026 forecast completion, I was asked to let go of a recently hired analyst. Considering our previous struggles with headcount reduction and the already extended working hours of the team, I found this demand unacceptable and consequently resigned the next day. Despite the challenging circumstances, I value my tenure at [Action Network](#https://www.actionnetwork.com/) and [Better Collective](#https://bettercollective.com/). It was a rich learning ground for leadership, team management during tough times, and the importance of resilience. While I regret not advocating more for my team, I am proud of the complex data projects we completed and the insight gained in explaining intricate machine learning concepts to business stakeholders. '),
