0149648,-0.008224596,0.01331667,0.03267759,0.014110151,-0.027130129,0.005223171,0.0089076795,-0.016794184,0.031408023,0.015924806,-0.034526747,-0.005395666,0.029338073,0.006741133,0.02223125,-0.015924806,0.031021632,-0.027185326,-0.004647035,0.006185697,-0.010156549,0.0030773238,-0.017318571,0.008535089,0.027571717,0.016504392,-0.021568866,0.03596191,0.018215548,0.0003003582,0.010287645,0.005319768,-0.032511994,-0.021265274,0.0088386815,-0.013696161,-0.013075177,0.010660236,0.008314294,0.011550314,0.008548888,0.007596712,0.012378293,-0.0038604543,0.024728987,-0.015607414,-0.02867569,-0.02903448,0.039411824,0.01858814,0.016435392,0.002582261,-0.022465844,0.045814864,0.019029729,0.019291922,-0.016035203,0.016738985,-0.008417792,-0.022452043,0.007990002,-0.0062167463,0.0030824987,-0.024839384,-0.001126397,0.0026788586,0.009397567,0.009639061,0.068059914,0.014986429,-0.028868886,-0.0026581592,-0.00017885651,0.01693218,0.007444916,0.023431819,-0.018284548,-0.02345942,0.0018094803,-0.0028427297,-0.026136553,-0.043441325,-0.008183197,0.013972154,0.026095154,0.014903631,-0.021927657,0.0017008078,0.013868657,-0.014834633,0.012033302,0.022272648,-0.016366394,-0.0056716595,0.025556967,0.0015377994,0.014186049,-0.04277894,0.010743034,0.0067963316,-0.040708993,-0.0048988787,0.000987538,0.009666661,-0.011046627,-0.016173199,0.007879605,0.029834861,0.0052783694,-0.0044365902,-0.025280975,-0.0077692075,-0.011640011,-0.0149174305,0.009349269,-0.013613363,-0.012488691]',0,'### Long-Term Revenue Forecasting #### Key Technologies - SQL - Redshift - Google Sheets - Python - SciKit Learn - Pandas - Numpy #### Description Transitioning from the revenue-share deal modeling, I embarked on an ambitious project to shape our long-term revenue vision. The target: to design a model that predicts monthly revenue through 2026 on a state-by-state basis. This granular approach was pivotal due to our revenue''s dependence on the legalization timeline of online gambling in each state. My initial assumption was to base the model on the combination of each state''s legalization timeline and the audience for each site/platform. However, exploratory data analysis surfaced a crucial insight: for most sites and platforms, state-level audience figures were heavily correlated with their respective legalization timelines. Consequently, audience numbers (monthly-active-users) had to be treated as an intermediary output, resulting from legalization, not a separate input to the overall model. With this understanding, the model''s design evolved into an integration of three sub-models, each addressing different facets of the business: - **State Legalization to MAU Sub-Model:** This sub-model took the month of state legalization as input and predicted Monthly Active Users (MAU) as output. I developed this sub-model using Redshift queries, Google Analytics data, and scraped online data to infer the legalization timelines. - **MAU to Affiliate Activations Sub-Model:** The output from the first model (MAUs) was then fed into this sub-model, which predicted affiliate activations by operator by state. This prediction was based on MAUs and the duration a state had been legal. - **Activations to LTV and Revenue Sub-Model:** The third sub-model took forecasts of activations (by month, state, and operator) and estimated the Lifetime Value (LTV) of each user. This was then used to generate a cumulative revenue total over the next four years (through 2026). Throughout the construction of these sub-models, I heavily relied on Python, Pandas, NumPy, and SciKit Learn to perform exploratory data analysis and highlight crucial factors for the modeling steps. All of this took place in various Jupyter notebooks. This rigorous data analysis proved instrumental when explaining the model to stakeholders. For instance, justifying why one site''s audience dropped when a state legalized online gambling (due to the site offering advice for fantasy sports, which were legal everywhere) was easier with data to support the claim. After the models were constructed, I codified the formulas into a comprehensive Google Sheet, complete with filters. This allowed stakeholders to validate and agree on the assumptions that made sense to them. The entire modeling process, which took about four weeks of intensive work (around 80 hours per week), was a massive undertaking that I''m incredibly proud of. Despite the business''s reservations about my conclusions, the project taught me a lot about conveying unwelcome information to executives, highlighting the importance of hard data in such conversations. It also served as a lesson in trusting new teammates to efficiently pick up slack on other projects while I focused on this monumental task. While the finance team ultimately adjusted my projections upwards without much reasoning ��� to my chagrin ��� I stand by the effort and diligence I put into this project.'),
