environment. Emphasizing the significance of in-person onboarding, I firmly believe that being present in the office fosters a superior learning experience. During the initial phase of my FanDuel journey, I primarily focused on daily operational reporting. This involved providing early morning updates and email communications to management, effectively tracking our progress towards organizational goals. Under the guidance of my excellent manager, Michael, I gained a solid foundation for success. He equipped me with an easily comprehensible email template and process for updating crucial numbers. With the freedom to learn from my mistakes without severe consequences, I ensured accurate accounting of contest prizes, enabling precise revenue calculations. This intricate process entailed running SQL queries to identify contests requiring manual intervention, updating CSV files, and uploading them to an Excel sheet serving as the "source of truth" for revenue. Although mistakes were infrequent, I found myself yearning for a more efficient workflow, leading to a series of projects that shaped my first year at FanDuel. '),
