uitive dashboards using Chartio and Looker. These dashboards empowered business stakeholders to effortlessly access data, surpassing the need for daily Excel downloads. To ensure real-time data availability, I established a pipeline of queries and data pulls, uploading our daily, weekly, and monthly targets into additional source tables. At this stage, the processes were executed locally using Python, and the incorporation of manual information into Redshift revolutionized our operational efficiency. '),
