n with chat bots and non-playable characters (NPCs) in video games, I embarked on an exciting project to build a Slackbot capable of executing queries and scripts against our data. However, the significance of this endeavor surpassed my initial expectations. Over time, I relied extensively on the Slackbot, streamlining tasks that used to take hours into mere minutes, even as I commuted to work in the morning. Leveraging the Slackbot, I automated daily reporting in a designated Slack channel, stimulating conversations among stakeholders in a central location. Moreover, I created a private chat interface that enabled individuals to assess their performance against specific targets. Employing Python, I built scripts to run queries against our Redshift database, while utilizing the Slack API and Webhooks to capture user input and determine the desired actions of the bot. This project remains one of the most gratifying achievements of my career, prior to my involvement in bootcamps starting in 2022. '),
