deviations from our official forecasts, with errors averaging around 6-8%. To address this challenge, we sought a more scientific approach to understand potential areas of forecast inaccuracies. Leveraging historical activation rates for various user types based on their spending levels and preferred sports, we employed spend and retention rates to predict user transitions among different segments and their corresponding expenditure on the platform. My responsibilities included building the Markov Chain portion of the model, comprehending the user-state machine, and presenting information in a manner that facilitated Devin''s analysis. Devin, on the other hand, developed the Monte Carlo simulation to provide upper and lower bounds for forecast expectations based on historical trends, user reactivation, retention, and acquisition spending. The resulting model proved significantly more accurate and yielded profound diagnostic insights compared to previous methods. SQL played a pivotal role in constructing the Markov Chain, and the Slackbot enabled seamless updates to the model''s information. For visualization and actionable insights, we employed Chartio alongside a customized Flask frontend, empowering our business partners to leverage the forecasts effectively. '),
