regularly explained intricate aspects of the Daily Fantasy ecosystem to executives. At Google, I rapidly became a go-to resource for coworkers seeking to improve their use of internal tools. At Action, I dedicated significant time to educating others, from explaining business dynamics to executives, teaching python to my team, or informing the rest of the company about the financial impacts of their work. I have also been teaching coding to children in my free time. You can count on me to uplift the team''s collective knowledge. 2. **Curiosity** - I''m intrinsically driven to learn and understand. Whether I''m delving into AI/ML and blockchain engineering, listening to tech, science, and business podcasts, or learning new skills to solve problems, my curiosity is always at the forefront. When I started at FanDuel, I didn''t know SQL; now I''m an expert. My curiosity, combined with my teaching ability, assures you that our collaboration will foster a continuous learning environment. 3. **High EQ** - While I don''t consider myself the best manager in the world, I know that people enjoy working with me and for me. I am a committed team player who cherishes a strong culture and understands the importance of emotional intelligence in the workplace. This is an area where many might claim proficiency, but I truly excel at understanding and empathizing with others.'),
