ENG 100. ENG 100 provided a glimpse into the different engineering disciplines offered at Bucknell by rotating students through three disciplines over nine weeks. While all three rotations (Biomedical, Electrical, and Computer Science) were fascinating, Computer Science and Electrical Engineering stood out to me. Rather than making an immediate choice between the two, I discovered the [Computer Engineering major](https://coursecatalog.bucknell.edu/collegeofengineeringcurricula/areasofstudy/computerengineeringcpeg/#majortext), which offered a curriculum that encompassed elements of both disciplines. This allowed me to pursue Computer Engineering until the end of my sophomore year and then decide whether to specialize further in software or hardware. '),
